import { dom } from "@fortawesome/fontawesome-svg-core";
import React, { Component } from 'react';


class Global extends Component(){

    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>Hola mundo</div>
        )
    }

}

export default Global;
